import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Signup() {
  const [activeLink, setActiveLink] = useState('register');

  const handleLinkClick = (link) => {
    setActiveLink(link);
  };

  return (
    <>
      <title>Signup Form</title>
      {/* FORMULAIRE DE CONNEXION */}
      <div className="card">
        <h2>Signup Form</h2>
        {/* SE CONNECTER / S'INSCRIRE */}
        <div className="login_register">
          <Link
            to="/login"
            className={`login ${activeLink === 'login' ? 'active' : ''}`}
            onClick={() => handleLinkClick('login')}
            target="_blank"
          >
            Login
          </Link>
          <Link
            to="/"
            className={`register ${activeLink === 'register' ? 'active' : ''}`}
            onClick={() => handleLinkClick('register')}
            target="_blank"
          >
            Signup
          </Link>
        </div>
        {/* FORMULAIRE */}
        <form className="form">
          <input type="username" placeholder="UserName" className="username" />
          <input type="email" placeholder="Email Adress" className="email" />
          <input type="password" placeholder="password" className="pass" />
          <input type="password" placeholder="Confirm Password" className="confirm_pass" />
        </form>
        {/* MOT DE PASSE OUBLIE ? */}
        <Link to="#" className="fp">
          Forgot password?
        </Link>
        {/* BOUTTON LOGIN */}
        <button type="submit" className="login_btn">
          Signup
        </button>
      </div>
    </>
  );
}

export default Signup;
